@bramhasmiiii Holidays are usually on secular days. Not on our festival. 

May day, Republic day , Independence day, Gandhi jayanthi are mandatory holidays. karnataka rajyotsava, Telangana State Formation Day are mandatory holidays
Where even ganesh chaturthi and dussera are optional holidays.

